import React, { Component } from 'react';
import './Footer.css'
const Footer = (props) =>(
    <footer>
        <div>© lietufy, 2019 . Visos teisės saugomos</div>
        <div className='spotify'>Powered by<span><i class="fab fa-spotify"></i> Spotify</span></div>
        <div>Created and designed by Dominykas Grubys</div>

    </footer>
    )
export default Footer;
